import React, { lazy } from 'react';
import { Redirect } from 'react-router-dom';
import DashboardLayout from './layouts/Dashboard';
import DashboardAnalyticsView from './views/KokaAnalytics/Dashboard';

export default [
  {
    path: '/',
    exact: true,
    component: () => <Redirect to="/koka-analytics/dashboard" />,
  },
  {
    route: '*',
    component: DashboardLayout,
    routes: [
      {
        path: '/koka-analytics/dashboard',
        exact: true,
        component: DashboardAnalyticsView,
      },
      {
        path: '/koka-admin/customers',
        exact: true,
        component: lazy(() => import('src/views/KokaAdmin/CustomerManagementList')),
      },
      {
        path: '/koka-admin/customers/:id',
        exact: true,
        component: lazy(() => import('src/views/KokaAdmin/CustomerManagementDetails')),
      },
      {
        path: '/koka-admin/customers/:id/:tab',
        exact: true,
        component: lazy(() => import('src/views/KokaAdmin/CustomerManagementDetails')),
      },
      {
        path: '/koka-admin/events',
        exact: true,
        component: lazy(() => import('src/views/KokaAdmin/EventManagementList')),
      },
      {
        path: '/koka-admin/events/:id',
        exact: true,
        component: lazy(() => import('src/views/KokaAdmin/EventManagementDetails')),
      },
      {
        path: '/koka-admin/devices',
        exact: true,
        component: lazy(() => import('src/views/KokaAdmin/DeviceManagementList')),
      },
      {
        path: '/koka-admin/devices/:id',
        exact: true,
        component: lazy(() => import('src/views/KokaAdmin/DeviceManagementDetails')),
      },
      {
        path: '/koka-studio/home',
        exact: true,
        component: lazy(() => import('src/views/KokaStudio/HomePage')),
      },
      {
        path: '/koka-studio/photos/:eventId',
        exact: true,
        component: lazy(() => import('src/views/KokaStudio/PhotosPage')),
      },
      {
        path: '/koka-studio/photo-preview/:photoId',
        exact: true,
        component: lazy(() => import('src/views/KokaStudio/PhotoPreviewPage')),
      },
    ],
  },
];
